"use strict";(self.webpackChunkwiki=self.webpackChunkwiki||[]).push([[8130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"tulbox","metadata":{"permalink":"/blog/tulbox","source":"@site/blog/2025-06-12-tulbox.md","title":"Tu\u0304lBOX V3","description":"\ud83d\ude80 Tu\u0304lBOX v3 is Live!","date":"2025-06-12T00:00:00.000Z","tags":[{"inline":true,"label":"tulbox","permalink":"/blog/tags/tulbox"}],"readingTime":0.78,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Coordinator, Film and TV Admin","page":{"permalink":"/blog/authors/zappbrandigan"},"imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"slug":"tulbox","title":"Tu\u0304lBOX V3","authors":["zappbrandigan"],"tags":["tulbox"]},"unlisted":false,"nextItem":{"title":"Welcome!","permalink":"/blog/welcome"}},"content":"## \ud83d\ude80 Tu\u0304lBOX v3 is Live!\\n\\nI\'m excited to announce that **Tu\u0304lBOX v3** is officially live!\\n\\nThis release brings a smoother experience, sharper performance, and improved APIs. The existing tools have been refined based on feedback from real-world use and the entire app has been rebuilt from the ground up. It is now ready to host additional tools as they get released!\\n\\n\x3c!-- truncate --\x3e\\n\\n### \u2705 What\u2019s New in v3\\n\\n* **Improved Speed** \u2013 Apps load faster and respond more smoothly.\\n* **Cleaner UI** \u2013 I redesigned the tools for clarity and flexibility.\\n* **More Reliable Automation** \u2013 Updated back-end pipelines to handle complex files more gracefully.\\n* **Better Metadata Handling** \u2013 The IMDb tool has a custom built API.\\n\\n### \ud83d\udca1 Why This Matters\\n\\nThis update makes it easier to add new tools that are in the works, such as CWR conversion and automated cue sheet stamping.\\n\\nThis is a 00 release, so there will be blood! I mean bugs. Reach out if you run into anything weird."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","source":"@site/blog/2025-06-09-welcome.md","title":"Welcome!","description":"Hi there \u2014 I\u2019m so glad you\u2019ve found your way here. This site is both a user guide for Tu\u0304lBOX, a growing collection of automation tools, and a living knowledge base for topics in music publishing, royalty collection, and the business of rights management.","date":"2025-06-09T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/blog/tags/hello","description":"Hello tag description"}],"readingTime":0.75,"hasTruncateMarker":true,"authors":[{"name":"Brandon Johnson","title":"Coordinator, Film and TV Admin","page":{"permalink":"/blog/authors/zappbrandigan"},"imageURL":"https://avatars.githubusercontent.com/u/482919?v=4","key":"zappbrandigan"}],"frontMatter":{"slug":"welcome","title":"Welcome!","authors":["zappbrandigan"],"tags":["hello"]},"unlisted":false,"prevItem":{"title":"Tu\u0304lBOX V3","permalink":"/blog/tulbox"}},"content":"Hi there \u2014 I\u2019m so glad you\u2019ve found your way here. This site is both a user guide for Tu\u0304lBOX, a growing collection of automation tools, and a living knowledge base for topics in music publishing, royalty collection, and the business of rights management.\\n\\n\x3c!-- truncate --\x3e\\n\\nA little about me: my background is in math and computer science \u2014 not music publishing. Like many who end up working behind the scenes in entertainment, I\u2019ve had to pick up a lot on the fly. As I learn the ins and outs of music publishing on the job, I\u2019ve been organizing what I\u2019ve found helpful, confusing, or just worth remembering into notes, guides, and tools \u2014 and adding them here.\\n\\nWhether you\u2019re new to music publishing, trying to automate a few tedious workflows, or just curious about how it all fits together, I hope this site helps make things a bit clearer.\\n\\nThanks for stopping by!"}]}}')}}]);